import React from 'react';
import { Layout } from '../components/commons/Layout';
export const Home = () => {
  return (
    <div>
      <Layout>
      <div class="container">
  <h2>Panel Heading</h2>
  <div class="panel panel-default">
    <div class="panel-heading">Panel Heading</div>
    <div class="panel-body">
    <p> That is a newsletter sending app. </p>
    </div>
  </div>
</div>
      
      </Layout>
    </div>
  )
}
